import Landing from './Landing'
function App() {

  return (
    <div className="App">


     {/* <Login/> */}
     <Router>
         <Link to="/Login">  <button> Login </button> </Link>
        {/* <Link to="/addPosts">  <button> Add Posts </button>   </Link>  */}
